def entailment_or_contradiction_or_neutral(travel_hours_premise, max_travel_hours_hypothesis):
    # the hypothesis talks about the number of hours Bhaman travelled, referenced also in the premise
    # check if the hypothesis contradicts the premise estimate by checking if the travel hours reported in the premise are more than 'max_travel_hours_hypothesis'
    if travel_hours_premise > max_travel_hours_hypothesis:
        return False
    else:
        return True

print(entailment_or_contradiction_or_neutral(travel_hours_premise, max_travel_hours_hypothesis))

distance_ratio_AB_BC_premise = 8 / 4
distance_ratio_AB_BC_hypothesis = 7 / 4

def entailment_or_contradiction_or_neutral(distance_ratio_AB_BC_premise, distance_ratio_AB_BC_hypothesis):
    # the hypothesis talks about the ratio of distances between A to B and B to C
    # check if the ratio mentioned in the hypothesis contradicts the ratio mentioned in the premise
    if distance_ratio_AB_BC_hypothesis != distance_ratio_AB_BC_premise:
        return False
    else:
        return True

print(entailment_or_contradiction_or_neutral(distance_ratio_AB_BC_premise, distance_ratio_AB_BC_hypothesis))

